mutation sitesUpdateSecondaryAwsVSocket ( $updateSecondaryAwsVSocketInput:UpdateSecondaryAwsVSocketInput! $accountId:ID! ) {
	sites ( accountId:$accountId ) {
		updateSecondaryAwsVSocket ( input:$updateSecondaryAwsVSocketInput  )  {
			secondaryAwsVSocketUpdateSecondaryAwsVSocketPayload: secondaryAwsVSocket {
				site  {
					id
					name
				}

				id 
				ipAddress 
				subnet 
				routeTableId 
			}
		}

	}	
}
